// React component: All Players' Picks Page (Tab 2)
import React, { useState } from 'react';

const AllPlayersPicksPage = () => {
  const [selectedWeek, setSelectedWeek] = useState('Week 1');

  // Example placeholder data
  const picksData = {
    'Week 1': [
      {
        player: 'Alice',
        picks: ['Packers', 'Lions', 'Argos'],
        winners: ['Packers'],
        weekPoints: 1,
        totalPoints: 3,
      },
      {
        player: 'Bob',
        picks: ['Bears', 'Bombers', 'Stampeders'],
        winners: ['Bombers'],
        weekPoints: 1,
        totalPoints: 4,
      },
    ],
    'Week 2': [], // Example with no data
  };

  const currentWeekData = picksData[selectedWeek];

  return (
    <div className="p-4 border rounded shadow bg-white">
      <h2 className="text-xl font-bold mb-4">üìã All Players' Picks Page</h2>

      <label className="block mb-2 font-semibold">üìÖ Select Week:</label>
      <select
        value={selectedWeek}
        onChange={(e) => setSelectedWeek(e.target.value)}
        className="border p-2 mb-4"
      >
        <option>Week 1</option>
        <option>Week 2</option>
        <option>Week 3</option>
        <option>Week 4</option>
        <option>Week 5</option>
        <option>Week 6</option>
        <option>Week 7</option>
        <option>Week 8</option>
        <option>Week 9</option>
        <option>Week 10</option>
        <option>Week 11</option>
        <option>Week 12</option>
        <option>Week 13</option>
        <option>Week 14</option>
        <option>Week 15</option>
        <option>Week 16</option>
      </select>

      {currentWeekData && currentWeekData.length > 0 ? (
        <div>
          <h3 className="text-lg font-semibold mb-2">‚úÖ Showing results for: {selectedWeek}</h3>
          <table className="w-full table-auto border">
            <thead>
              <tr>
                <th className="border px-2">Player Name</th>
                <th className="border px-2">Picks</th>
                <th className="border px-2">Winners</th>
                <th className="border px-2">Week Pts</th>
                <th className="border px-2">Total Pts</th>
              </tr>
            </thead>
            <tbody>
              {currentWeekData.map((entry, index) => (
                <tr key={index}>
                  <td className="border px-2">{entry.player}</td>
                  <td className="border px-2">{entry.picks.join(', ')}</td>
                  <td className="border px-2">{entry.winners.join(', ')}</td>
                  <td className="border px-2 text-center">{entry.weekPoints}</td>
                  <td className="border px-2 text-center">{entry.totalPoints}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      ) : (
        <p className="text-red-600 font-semibold mt-4">‚ùó There is no data for the selected week, please select a different week.</p>
      )}
    </div>
  );
};

export default AllPlayersPicksPage;
